ound-repeat:no-repeat}\nli.list-num2-paddingleft-1{padding-left:35px}\nli.list-num2-paddingleft-2{padding-left:40px}\nli.list-dash{background-image:url(http://bs.baidu.com/listicon/dash.gif)}\nul.custom_dash{list-style:none;}ul.custom_dash li{background-position:0 3px;background-repeat:no-repeat}\nli.list-dash-paddingleft{padding-left:35px}\nli.list-dot{background-image:url(http://bs.baidu.com/listicon/dot.gif)}\nul.custom_dot{list-style:none;}ul.custom_dot li{background-position:0 3px;background-repeat:no-repeat}\nli.list-dot-paddingleft{padding-left:20px}\n.list-paddingleft-1{padding-left:0}\n.list-paddingleft-2{padding-left:30px}\n.list-paddingleft-3{padding-left:60px}</style><style id=\"pagebreak\">.pagebreak{display:block;clear:both !important;cursor:default !important;width: 100% !important;margin:0;}</style><style id=\"pre\">pre{margin:.5em 0;padding:.4em .6em;border-radius:8px;background:#f8f8f8;}</style><style id=\"loading\">.loadingclass{display:inline-block;cursor:default;background: url(\'http://192.168.31.195:8080/demo/ueditor/themes/default/images/loading.gif\') no-repeat center center transparent;border:1px solid #cccccc;margin-left:1px;height: 22px;width: 22px;}\n.loaderrorclass{display:inline-block;cursor:default;background: url(\'http://192.168.31.195:8080/demo/ueditor/themes/default/images/loaderror.png\') no-repeat center center transparent;border:1px solid #cccccc;margin-right:1px;height: 22px;width: 22px;}</style><style id=\"anchor\">.anchorclass{background: url(\'http://192.168.31.195:8080/demo/ueditor/themes/default/images/anchor.gif\') no-repeat scroll left center transparent;cursor: auto;display: inline-block;height: 16px;width: 15px;}</style><style type=\"text/css\">body{background-color:#ffffff; background-image:; background-repeat:repeat; background-position:0% 0%; height:1216px; }</style> </head><body ><p style=\"text-align: center;\">房子是租来的，但生活不是。</p><p style=\"text-align: center;\">你理想的生活只差一个舒适的小窝！！！</p><p style=\"text-align: center;\">生活有讲究，租房不将就！</p><p style=\"text-align: center;\">&nbsp;<img src=\"http://192.168.31.195:8080/demo//ueditor/jsp/upload/image/20180527/1527436619284023441.png\" title=\"1527436619284023441.png\" alt=\"图片1.png\" width=\"379\" height=\"266\"/></p><p style=\"text-align: center;\">【房间情况】</p><p style=\"text-align: center;\">房间选址安静宜居、出行便利。</p><p style=\"text-align: center;\">室内全新配置和24H免费畅享高速宽带。</p><p style=\"text-align: center;\">小区绿化30%以上，电梯房。</p><p style=\"text-align: center;\">只为下班后的您住的安心、住的舒心。&nbsp;</p><p style=\"text-align: center;\">&nbsp;<img src=\"http://192.168.31.195:8080/demo//ueditor/jsp/upload/image/20180527/1527436672775075496.png\" title=\"1527436672775075496.png\" alt=\"图片2.png\" width=\"380\" height=\"155\"/></p><p style=\"text-align: center;\"><img src=\"http://192.168.31.195:8080/demo//ueditor/jsp/upload/image/20180527/1527436719031001879.png\" title=\"1527436719031001879.png\" alt=\"图片3.png\" width=\"376\" height=\"295\"/></p><p style=\"text-align: center;\">【周边设施】</p><p style=\"text-align: center;\">住房也要方便出行，房源小区门口就是地铁站或公交站；</p><p style=\"text-align: center;\">周边餐厅、公园、影院、菜市场和运动场环绕其中。</p><p style=\"text-align: center;\">【温馨提示】</p><p style=\"text-align: center;\">房屋面积12 m²，4室1厅2卫，朝南 [合租]</p><p style=\"text-align: center;\">楼层22/34 层，地址庙山新村</p><p style=\"text-align: center;\">价格：1080元/月</p><p style=\"text-align: center;\">看房联系电话：13472702110</p><p><br/></p></body></html>', '2018-05-28 00:01:33', '\0');
