梦想的开始有多难？人生的第一封简历，应该如此。</p><p style=\"text-align: center;\">正装照，是你朝向职业大门的第一块敲门砖。</p><p style=\"text-align: center;\">这张小照片，也将陪伴你大半生的职业生涯，因此它也必须展现你的自信、专业与坚毅。</p><p style=\"text-align: center;\">我们不会让能力出众的你，在简历里看上去却是专业不合格的样子。</p><p style=\"text-align: center;\">请相信有间相馆的专业，会为你拍一张你最自信的模样的照片，去迎接一个残酷又充满挑战的世界。</p><p style=\"text-align: center;\">面对实习毕业的浪潮，我们准备好了。那你呢？</p><p style=\"text-align: center;\"><img src=\"http://192.168.31.195:8080/demo//ueditor/jsp/upload/image/20180528/1527437073058008061.png\" title=\"1527437073058008061.png\" alt=\"20180528000401.png\"/>&nbsp;</p><p style=\"text-align: center;\">有间相馆新店开业，精美正装照，只需38元。</p><p style=\"text-align: center;\">活动时间： 2017年9月9日 至 2017年10月31日 。</p><p style=\"text-align: center;\">店铺地址：武汉纺织大学阳光校区 普安新村113号</p></body></html>', '2018-05-28 00:05:34', '\0');

